runtimeScene.ws.onmessage = function (event) {
    const e = JSON.parse(event.data);
    //console.log("Full : ",e);
    if (e.msg === "exit\n") {
        disconnectWebSocket(runtimeScene);
    }
    switch(e.type) {
        case "connect":
            newUser(e);
            break;
        case "action":
            if (e.dir === "up") {
                upMovement(e);
            }
            else if (e.dir === "down") {
                downMovement(e);
            }
            else if (e.dir === "right") {
                rightMovement(e);
            }
            else if (e.dir === "left") {
                leftMovement(e);
            }
            break;
        case "chat":
            manageChat(e);
            break;
    }
}

